  return (
    <>
      <StudentNavBar />
      <div
        style={{ textAlign: "center", marginTop: "30vh", marginBottom: "50px" }}
      >
        PAPER TITLE YEAR EXAM SUBJECT
      </div>
      <Box textAlign="center">
        <Button variant="outlined" color="inherit">
          START
        </Button>
      </Box>
    </>
  );
};

export default PaperStart;
